import React from 'react'

const titleSizes = ["large", "medium", "small"]

const Title = (props, titleSize) => {
  return (
    <h3 className={"title" + titleSizes.includes(titleSize) ? titleSize : titleSizes[0]} >{props.children}</h3>
  )
}

export default Title
